import React, { useState } from "react";
import { Wallet, JsonRpcProvider, formatEther, parseEther } from "ethers";
import QRCode from "qrcode.react"; // Make sure you're using the right version or import QRCodeCanvas
import "./App.css"; // optional if you have styles

const provider = new JsonRpcProvider("https://data-seed-prebsc-1-s1.binance.org:8545/");

function App() {
  const [wallet, setWallet] = useState(null);
  const [privateKey, setPrivateKey] = useState("");
  const [mnemonic, setMnemonic] = useState("");
  const [balance, setBalance] = useState("");
  const [recipient, setRecipient] = useState("");
  const [amount, setAmount] = useState("");
  const [txHash, setTxHash] = useState("");
  const [showHistory, setShowHistory] = useState(false); // âœ… FIXED

  const createWallet = async () => {
    const newWallet = Wallet.createRandom();
    setWallet(newWallet);
    setPrivateKey(newWallet.privateKey);
    setMnemonic(newWallet.mnemonic.phrase);
  };

  const fetchBalance = async () => {
    if (!wallet) return;
    const connectedWallet = wallet.connect(provider);
    const bal = await provider.getBalance(connectedWallet.address);
    setBalance(formatEther(bal));
  };

  const sendBNB = async () => {
    if (!wallet || !recipient || !amount) return;
    const connectedWallet = wallet.connect(provider);
    const tx = await connectedWallet.sendTransaction({
      to: recipient,
      value: parseEther(amount),
    });
    await tx.wait();
    setTxHash(tx.hash);
    fetchBalance(); // Refresh balance
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial", background: "#f5f5f5", minHeight: "100vh" }}>
      <h1 style={{ color: "#1e88e5" }}>ðŸŒ€ Goan Wallet</h1>

      <button onClick={createWallet} style={{ padding: "10px", margin: "10px 0", backgroundColor: "#4caf50", color: "white", border: "none", borderRadius: "5px" }}>
        Generate Wallet
      </button>

      {wallet && (
        <div style={{ marginTop: "20px", padding: "10px", background: "#fff", borderRadius: "10px", boxShadow: "0 0 5px rgba(0,0,0,0.1)" }}>
          <p><strong>Address:</strong> {wallet.address}</p>
          <p><strong>Private Key:</strong> {privateKey}</p>
          <p><strong>Mnemonic:</strong> {mnemonic}</p>
          <QRCode value={wallet.address} size={128} />
        </div>
      )}

      <div style={{ marginTop: "20px" }}>
        <button onClick={fetchBalance} style={{ padding: "10px", backgroundColor: "#2196f3", color: "white", border: "none", borderRadius: "5px" }}>
          Fetch BNB Balance
        </button>
        {balance && <p><strong>BNB Balance:</strong> {balance}</p>}
      </div>

      <div style={{ marginTop: "20px", background: "#fff", padding: "10px", borderRadius: "10px", boxShadow: "0 0 5px rgba(0,0,0,0.1)" }}>
        <h3>Send BNB</h3>
        <input
          type="text"
          placeholder="Recipient Address"
          value={recipient}
          onChange={(e) => setRecipient(e.target.value)}
          style={{ padding: "8px", width: "100%", marginBottom: "10px", borderRadius: "5px", border: "1px solid #ccc" }}
        />
        <input
          type="text"
          placeholder="Amount in BNB"
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
          style={{ padding: "8px", width: "100%", marginBottom: "10px", borderRadius: "5px", border: "1px solid #ccc" }}
        />
        <button onClick={sendBNB} style={{ padding: "10px", backgroundColor: "#f44336", color: "white", border: "none", borderRadius: "5px" }}>
          Send BNB
        </button>
        {txHash && <p><strong>Transaction Hash:</strong> {txHash}</p>}
      </div>

      {/* Transaction History Toggle */}
      <div style={{ marginTop: "20px" }}>
        <button onClick={() => setShowHistory(!showHistory)} style={{ padding: "8px", background: "#673ab7", color: "white", border: "none", borderRadius: "5px" }}>
          {showHistory ? "Hide" : "Show"} Transaction History
        </button>

        {showHistory && (
          <div style={{ marginTop: "10px" }}>
            <p><em>Coming soon: transaction history list.</em></p>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
